import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import NavbarComp from './component/navigation/NavbarComp';
import { TextField } from '@mui/material';

function App() {
  return (
    <div className="App">
      <NavbarComp/>
      <TextField/>
      <Button/>
    </div>
  );
}

export default App;
